sourcesContent:
import React, { Component } from "react";
import Navigation from "./Navigation";
import { Link } from "react-router-dom";
import {
  Typography,
  Card,
  CardContent,
  CardActions,
  Grid,
  Paper,
  Button,
  TextField,
} from "@material-ui/core";
import {
  TimelineOppositeContent,
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineDot,
  TimelineConnector,
  TimelineContent,
  Autocomplete,
} from "@material-ui/lab";
import SchoolIcon from "@material-ui/icons/School";
import cpp from "./images/cpp.png";
import CasinoIcon from "@material-ui/icons/Casino";
import ComputerIcon from "@material-ui/icons/Computer";
import LibraryBooksIcon from "@material-ui/icons/LibraryBooks";
import StorageIcon from "@material-ui/icons/Storage";
import java from "./images/java.png";
import sql from "./images/sql.png";
import mongo from "./images/mongo.png";
import c from "./images/cicon.png";
import logo from "./images/logo192.png";
import javascript from "./images/javascript.png";
import python from "./images/python.png";
import WorkIcon from "@material-ui/icons/Work";
import SportsEsportsIcon from "@material-ui/icons/SportsEsports";
import AndroidIcon from "@material-ui/icons/Android";
import astudiologo from "./images/astudio.png";
import InstagramIcon from "@material-ui/icons/Instagram";
import SearchIcon from "@material-ui/icons/Search";
import EnhancedEncryptionIcon from "@material-ui/icons/EnhancedEncryption";
import VpnLockIcon from "@material-ui/icons/VpnLock";
import golang from "./images/golang.jpg";
import ScreenLockPortraitIcon from "@material-ui/icons/ScreenLockPortrait";

const classes = {
  primaryTrail: {
    backgroundColor: "#ffd536",
  },

  secondaryTail: {
    backgroundColor: "#00274c",
  },

  card: {
    backgroundColor: "#c4c4c4",
  },

  mobileCard: { margin: "3%", width: "75%" },
};

const top100Films = [
  { title: "Euchre" },
  { title: "Log Manager" },
  { title: "FakeBook" },
  { title: "CPU Simulator" },
  { title: "FactSet Internship" },
  { title: "Wheel of Fortune Game" },
  { title: "Budget Manager App" },
  { title: "Instagram Clone" },
  { title: "Search Engine" },
  { title: "Crypto and Web Security" },
  { title: "Man in the Middle" },
  { title: "Application Security/Buffer Overflows" },
  { title: "Future Projects" },
];

const euchre = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Euchre
      </Typography>
      <Typography variant="caption">
        Designed and implemented a fully functional version of the popular
        midwestern card game 'Euchre'. This project was meant to build up OOP
        skills and push students to use things like overloaded operators and
        inheritance. Featured computer players as well as human players.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={cpp} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const logMan = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Log Manager
      </Typography>
      <Typography variant="caption">
        In UM's infamous 'EECS281' I completed 4 relatively challenging c++
        projects aimed at teaching good programming practice under strict
        runtime and memory constraints. Most of these were just puzzle solving
        programs, but the Log Manager was unique in that it was a very useful
        application. It was capable of reading in massive log files, processing
        them, and making records retrievable in constant o(1) time with multiple
        search parameters and filters available to the user.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={cpp} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const fakeBookCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        FakeBook
      </Typography>
      <Typography variant="caption">
        In my database management systems upper level course, we learned SQL and
        MobgoDB along with the theory behind building schema and relations. The
        projects were sequential and centered around a ripoff of the popular
        social media website. The first project was centered around creating a
        database schema that could satisfy the unique constraints of such a
        website. The following project was centered around actually utilizing
        that database that was artificially populated to fetch queries, many of
        which were very niche and challenged our ability to use SQL. The
        following project doubled down on sql skills while introducing students
        to MongoDB, another popular query language.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5} style={{ alignContent: "end" }}>
        <Grid item xs={3} style={{ alignSelf: "end" }}>
          <img src={java} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>{" "}
        <Grid item xs={3} style={{ alignSelf: "end" }}>
          <img src={sql} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3} style={{ alignSelf: "end" }}>
          <img
            src={mongo}
            alt="f"
            style={{
              width: "80%",
              height: "50%",
              justifySelf: "end",
            }}
          />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const simCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        CPU simulation
      </Typography>
      <Typography variant="caption">
        EECS370, an intro to computer architecture class, had sequential
        projects meant to simulate internal workings of a computer. In this
        class we learned and wrote a few programs in assembly, but more
        importantly created an assembler, linker, pipeline simulator, and
        cache/virtual memory system simulator in the c programming language.
        These projects greatly boosted my understanding of how a computer
        compiles, assembles, and ultimately executes programs.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={c} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>{" "}
      </Grid>
    </CardActions>
  </Card>
);

const factSetCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        FactSet Internship
      </Typography>
      <Typography variant="caption">
        Although I cannot talk about specifics on this one, I used reactjs,
        javascript, and python to create a large standalone application that
        automated and assisted with tasks that some users found challenging. As
        far as I am aware, this application still serves a purpose and has
        active users.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img
            src={javascript}
            alt="f"
            style={{ width: "80%", height: "auto" }}
          />
        </Grid>
        <Grid item xs={3}>
          <img src={logo} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          <img src={python} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const wheelCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Wheel of Fortune
      </Typography>
      <Typography variant="caption">
        In EECS 285, a technical elective class centered around java
        programming, I created a fun wheel of fortune application using the
        Swing UI library. One feature the game lacks that I may add in the
        feature is randomized puzzles from a bank. Currently, a non-player is
        needed to enter a puzzle. The game features animated wheel spaces and a
        display that resembles the actual gameshow.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={java} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const budgetCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Budget App
      </Typography>
      <Typography variant="caption">
        Another project for my java elective, I developed a standalone
        application for the android OS using the android studio. The application
        was a budget tracker that saved data and was able to keep track of
        categories automatically alongside individual transactions. This
        application is not published in the android marketplace, but I do plan
        to take a stab at publishing an application soon (likely to the Apple
        app store, however).
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={java} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          <img
            src={astudiologo}
            alt="f"
            style={{ width: "80%", height: "auto" }}
          />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const instaCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Insta485
      </Typography>
      <Typography variant="caption">
        Created a webstie mock of the popular social media site, Instagram. Took
        advantage of both client and server side dynamic pages using reactjs and
        pythons flask library. Supported users creating their own accounts,
        editing said accuont, uploading images, liking and commenting on images,
        a custom API, and session data among other things. Users were able to
        delete posts, comments, and accounts as well and the website even
        featured the popular double tap to like feature. The database was
        secure, resistant to sql injection and passwords were salted to avoid
        dictionary attacks. Database was written and queried in sql.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={python} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          {" "}
          <img src={logo} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          {" "}
          <img src={sql} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          <img
            src={javascript}
            alt="f"
            style={{ width: "80%", height: "auto" }}
          />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const searchEngineCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Search Engine
      </Typography>
      <Typography variant="caption">
        First, we built a custom mapreduce server that utilized threads and
        processes to implement a master along with any number of workers to run
        jobs. This server had all the goodies including fault tolerance.
        Afterwards, we utilized the mapreduce framework along with hadoop to
        create a pipeline script capable of calculating tf-idf scored for
        massive documents. Combining these scores with PageRank, we were able to
        create a lightweight search engine mock. The frontend was a very simple
        raw html/css design as the focus of this project was on the index and
        mapreduce server itself.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={python} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const cryptoCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Crypto and Web Security
      </Typography>
      <Typography variant="caption">
        We learned to implement common malicious attacks in order to better
        understand how to spot vulnerabilties in different software
        applications. The first two projects were aimed at attacking web
        systems. We learned how to attack and defend against sql injections,
        including those that work against systems that immediately hash or
        encrypt input. We learned how padding oracles can be abused and how
        certain hash functions can be abused by length extension. Finally, we
        implemented cross site scripting attacks as well as cross site request
        forgeries and learned how web/browser designers can defend against these
        sorts of attacks. NOTE: All attacks implemented in this class were in a
        controlled environment against domains created by the University of
        Michigan with the intention of being attacked.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={python} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          {" "}
          <img src={sql} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
        <Grid item xs={3}>
          <img
            src={javascript}
            alt="f"
            style={{ width: "80%", height: "auto" }}
          />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const mitmCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Man in the Middle Attack
      </Typography>
      <Typography variant="caption">
        In our network security component of the class we first created a small
        program in Golang that was able to sniff out ARP spoofers and DNS
        spoofers on a network. Afterwards, we implemented a much larger program,
        a MITM attack that worked in 6 stages. First, it would intercept any
        packets determined to be headed for a (obviously fake) bank. Afterwards,
        it would alter the http request to route the money to an account of our
        chosing. We would the receive the response, alter the response to avoid
        suspicion, copy any media files that may have been included, and forward
        the response. We could handle logins and logouts as well. This project
        taught me a lot not only about why https is important, but also about
        the different layers of network protocol and how the tranfer of data
        over networks really works.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={golang} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const appsecCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Application Security and Buffer Overflows
      </Typography>
      <Typography variant="caption">
        My last security project of note was an application security project
        where we used the GDB debugger to dissasemble c programs and find
        vulnerabilities that would allow us to spawn a root shell. This project
        was eye opening becuase it showed how bad coding pratices can be easily
        abused even in the presence of things like data execution prevention on
        the stack and variable stack offsets. The last of 8 targets was a C
        program with DEP and an offset stack that had no system calls to abuse.
        Here we learned how ROP chains can be put together to abuse even the
        most secure application environments if programmers leave
        vulnerabilities in their code.
      </Typography>
    </CardContent>
    <CardActions>
      <Grid container spacing={5}>
        <Grid item xs={3}>
          <img src={c} alt="f" style={{ width: "80%", height: "auto" }} />
        </Grid>
      </Grid>
    </CardActions>
  </Card>
);

const futureCard = (
  <Card style={classes.mobileCard}>
    <CardContent>
      <Typography variant="h6" component="h1" align="center">
        Whats Next?
      </Typography>
      <Typography variant="caption">
        Currently I am developing an IOS/Android app while navigating my final
        semester of college.
      </Typography>
    </CardContent>
  </Card>
);

class Projects extends Component {
  state = {
    mobileDiv: <div></div>,
  };

  onChange = (event, value) => {
    if (value === null) {
      return;
    }
    const switcher = value["title"];
    if (switcher === "Euchre") {
      this.setState({ mobileDiv: euchre });
    } else if (switcher === "Log Manager") {
      this.setState({ mobileDiv: logMan });
    } else if (switcher === "FakeBook") {
      this.setState({ mobileDiv: fakeBookCard });
    } else if (switcher === "CPU Simulator") {
      this.setState({ mobileDiv: simCard });
    } else if (switcher === "FactSet Internship") {
      this.setState({ mobileDiv: factSetCard });
    } else if (switcher === "Wheel of Fortune Game") {
      this.setState({ mobileDiv: wheelCard });
    } else if (switcher === "Budget Manager App") {
      this.setState({ mobileDiv: budgetCard });
    } else if (switcher === "Instagram Clone") {
      this.setState({ mobileDiv: instaCard });
    } else if (switcher === "Search Engine") {
      this.setState({ mobileDiv: searchEngineCard });
    } else if (switcher === "Crypto and Web Security") {
      this.setState({ mobileDiv: cryptoCard });
    } else if (switcher === "Man in the Middle") {
      this.setState({ mobileDiv: mitmCard });
    } else if (switcher === "Application Security/Buffer Overflows") {
      this.setState({ mobileDiv: appsecCard });
    } else if (switcher === "Future Projects") {
      this.setState({ mobileDiv: futureCard });
    }
  };

  render() {
    if (window.screen.availWidth < 828) {
      return (
        <div>
          <Navigation />

          <div
            style={{
              width: "97%",
              marginTop: "2vh",
              display: "flex",
              justifyContent: "center",
              flexWrap: "wrap",
            }}
          >
            <Typography variant="h6" align="center">
              Want to know what I've been up to?
            </Typography>
            <div style={{ width: "100%", height: "0" }}></div>
            <Typography variant="subtitle2" align="center">
              Interact below to load details about my past projects.
            </Typography>
            <div style={{ width: "100%", height: "0" }}></div>
            {this.state.mobileDiv}
            <Autocomplete
              id="combo-box-demo"
              onChange={this.onChange}
              options={top100Films}
              getOptionLabel={(option) => option.title}
              style={{ width: 300 }}
              renderInput={(params) => (
                <TextField
                  {...params}
                  label="Select Project"
                  variant="outlined"
                />
              )}
            />
            <Link to="/contact" style={{ textDecoration: "none" }}>
              <Button
                variant="contained"
                color="primary"
                style={{
                  marginTop: "3%",
                  color: "white",
                }}
              >
                Request a Repo
              </Button>
            </Link>
          </div>
        </div>
      );
    } else {
      return (
        <div>
          <Navigation />
          <div>
            <div
              style={{
                display: "flex",
                justifyContent: "center",
                flexWrap: "wrap",
              }}
            >
              <div
                style={{
                  width: "80%",
                  marginTop: "2vh",
                  display: "flex",
                  justifyContent: "center",
                  flexWrap: "wrap",
                }}
              >
